import React from 'react';
import '../App.css';


function Contactt() {
return (
    <div className='header'>
        <div className="banner">
            <p>Himanshu Kumar</p>
            <p>Email: kumarhiman29@gmail.com</p>
            <p>Phone: 7250051734</p>
            <p>&#169; May 2023</p>
        </div>
    </div>
  );
}

export default Contactt;
